import './App.css';
import TopBar from './components/topbar';
import banner from './assets/document.jpeg'

function App() {
  return (<div className='flex-1 flex-col'>
    <TopBar/>
    <img src={banner} alt='banner' className='m-10'/>
    </div>  );
}

export default App;
